css:
.conflict-resolved {
  background: rgba(255, 255, 255, 0.07);
}
.conflict-ours {
  background: #237e4f;
}
.conflict-ours.cursor-line {
  background: #185636;
}
.conflict-theirs {
  background: #386d84;
}
.conflict-theirs.cursor-line {
  background: #284f60;
}
.conflict-dirty {
  background: #433d03;
}
.conflict-dirty.cursor-line {
  background: #746a05;
}
